import React from "react";
import Aux from "./Auxliliary/Auxiliary";
import "./App.css";

const Emoji = (props) => {
  let text = "";
let {x,y, z} = props;
if (x ===y & y === z){
  text = "They are Matching";
  return <p style = {{color: "blue"}}>text</p>
}
else{
  text = "They are not Matching";
  text = <p style = {{color: "red"}}>text</p>
}

  return (
    <Aux>
    <div className = "div4">
            <span>{x} {y} {z}</span>
            <span>{text}</span>
    </div>
            
    </Aux>
  );
};

export default Emoji;
